        "title": "4000¬∞ PLASMA PROTO-LIGHTSABER BUILD (RETRACTABLE BLADE!)",
        "description": "Download and play AFK Arena for free ‚ñ∫ https://bit.ly/3cvZ7dB \nUse these bonus codes: BestRPG4BusyU and uf4shqjngq to get awesome rewards.\n\nBecome a Hacksmith member get exclusive perks, like watching our Lightsaber Test video right now! ‚ñ∫‚ñ∫‚ñ∫ https://youtu.be/ey_EjSzKFWQ\nYou'll also get...\n‚ñ∫Project design files (CAD)!\n‚ñ∫Merch Discounts!\n‚ñ∫Collaborate with us on our videos!\n\nTry Altium Designer for Free and start designing your own PCBs ‚ñ∫ https://www.altium.com/asp/hacksmith\nView & share electronic designs online ‚ñ∫https://www.altium.com/viewer/\n\nCheck out the circuit diagram at Maker.IO ‚ñ∫ https://www.digikey.com/en/maker/projects/the-hacksmith-retractable-plasma-lightsaber/d14232ad19c4454ebdc1dd6bbaef5f78\n\nMake your own PCBs ‚ñ∫ https://jlcpcb.com/  \n$2  2Layer 5PCBs!\n$5  4 Layer 5PCBs!\n\nEpic Starwars Music and more by Samuel Kim ‚ñ∫ https://www.youtube.com/user/samuelkimmusic\n\nThe hilt design was inspired by multiple different renderings we found online, with some of the main inspiration from Adam Rzatkowski ‚ñ∫ www.artstation.com/aionard\n\nSOCIAL\nWebsite ‚ñ∫ http://www.hacksmith.tech\nFacebook ‚ñ∫ http://www.facebook.com/thehacksmith\nInstagram ‚ñ∫ http://www.instagram.com/thehacksmith\nTwitter ‚ñ∫ http://twitter.com/thehacksmith\nPatreon ‚ñ∫ http://www.patreon.com/thehacksmith\nDiscord ‚ñ∫ https://discordapp.com/invite/thehacksmith \nMerch ‚ñ∫ https://www.hacksmith.store\n\nCHAPTERS:\n0:00 Teaser\n0:33 A real retractable lightsaber\n3:28 New hilt design\n4:17 Support our channel!\n5:22 Building new hilt\n9:07 How does it work?\n12:00 Different blade colors?\n13:22 Electronics\n15:00 Powerpack\n16:27 World's First Retractable Lightsaber\n17:05 TEST!\n\nSOFTWARE:\nVideo Review / Collaboration ‚ñ∫ http://r.frame.io/pZq3N\nVideo Editing ‚ñ∫ Adobe Premiere \nVFX ‚ñ∫ https://productioncrate.grsm.io/Hacksmith\nCAD ‚ñ∫ Solidworks \nCAM ‚ñ∫ Autodesk HSM http://bit.ly/HSMworks\n\nCAMERA GEAR:\nHighspeed Cam - Chronos 1.4 ‚ñ∫ http://bit.ly/chronosCam\nMain shooter - Panasonic GH5s ‚ñ∫ https://bhpho.to/2Fjd80N \nPhone - Samsung S10  ‚ñ∫ https://bhpho.to/2N8FOh8\nCamcorder - Sony Handycam ‚ñ∫ https://bhpho.to/2FDnq81 \nAction Cam - GoPro ‚ñ∫ https://bhpho.to/2FxXDC4 \nSteadicam - Removu K1 ‚ñ∫ https://bhpho.to/2N9lDQq \nMain mic - Sennheiser ‚ñ∫ https://bhpho.to/2DsR8ec\nBendy Tripod ‚ñ∫ https://bhpho.to/2FyLNb0 \nMain Tripods - old second hand Manfrotto tripods no longer sold. \nStudio Light - Luxli ‚ñ∫ https://bhpho.to/2N9SPav\n\nTOOLS / MACHINES: \nCNC Waterjet Cutter ‚ñ∫ http://bit.ly/wazerJet\nCNC Plasma Cutter ‚ñ∫ http://bit.ly/EMTplasma\n3d Printers ‚ñ∫ http://bit.ly/H1Printer\nCNC Mill ‚ñ∫  http://bit.ly/PCNC440\nCNC Lathe ‚ñ∫ http://bit.ly/15LSlantPro\nLaser Cutter - Gweike LG900N 80W ‚ñ∫ http://lmgtfy.com/?q=lg900n \n3d Scanner ‚ñ∫ http://amzn.to/2pwbvTu\nDrills, drivers, grinders, saws, etc ‚ñ∫ http://amzn.to/2p9SPJ3 \nMig Welder ‚ñ∫ http://bit.ly/MP250iWelder\nTig Welder ‚ñ∫ http://bit.ly/Tig200Welder\nQuiet Air Compressor ‚ñ∫ http://bit.ly/38zVKzB\nDesktop PC ‚ñ∫ https://youtu.be/gSbt3LK8hCs \n\nMUSIC IN ORDER OF APPEARANCE:\nBattle Of The Heroes X Duel Of Fates\nBy Samuel Kim\nhttps://www.youtube.com/c/samuelkimmusic \nhttps://twitter.com/samuelkimmusic \nhttps://www.instagram.com/samuelkimmusic \n\nWorlds Apart by G. Scott Russell\nLicensed from Triple Scoop Music ‚ñ∫\nhttps://triplescoopmusic.com/\n\nScorpion by Zac Nelson\nLicensed from Triple Scoop Music ‚ñ∫\nhttps://triplescoopmusic.com/\n\nKenobi Theme by Samuel Kim\n\nJungle by Pink Shark\nLicensed from Triple Scoop Music ‚ñ∫\nhttps://triplescoopmusic.com/\n\nPurchases made through some store links may provide some compensation to Hacksmith.\n\nWARNING: THESE VIDEOS ARE FOR ENTERTAINMENT PURPOSES ONLY. PERSONAL USE OF VIDEO CONTENT IS AT YOUR OWN RISK. THE HACKSMITH IS A TRAINED PROFESSIONAL WHO KNOWS EXACTLY WHAT HE'S DOING. EXCEPT WHEN HE DOESN'T. DO NOT ATTEMPT TO RECREATE OR RE-ENACT ANYTHING SHOWN IN